const responsemap_namespaceObject = /*#__PURE__*/JSON.parse('{"what is somnia?":"Somnia is an EVM based layer 1 blockchain. It is noted for its fast speed. It is capable of processing over 1,000,000 transactions per second (TPS) with sub-second finality and is suitable for serving millions of users and building real-time, fully on-chain mass-consumer applications like games, social applications, metaverses, etc. \\n https://docs.somnia.network \\n https://blog.somnia.network","how can i get started on somnia?":"Please refer to the docs on the Somnia website. The docs cover the details extensively right from connecting your wallet. \\n https://docs.somnia.network/get-started/connect-your-wallet","what are some cool projects on somnia?":"There are many great projects on Somnia. Here are some of them: \\n 1. Lucky Adventure Gambit: Turn based RPG, dice-based game mechanics \\n https://playlag.com/ \\n 2. Somnex: Native one stop deFi on Somnia \\n https://testnet.somnex.xyz/ \\n 3. Somnia Exchange: Native dex on Somnia \\n https://somnia.exchange/ \\n 4. ForU AI: Enables people to create AI generated avatars for their decentralized identities \\n https://foruai.io/ \\n 5. Quills: The first PFP NFT collection on Somnia \\n https://quills.fun/ \\n 6. NFTs2Me: No code art generator, token gating, and more \\n https://nfts2me.com/ \\n 7. QSTN: Survey-to-Earn platform \\n https://qstn.us/  \\n All the other projects on Somnia can also be viewed on https://testnet.somnia.network in the App Hub section.","what are the network details of somnia?":"Currently, Somnia is in the testnet phase. You can directly connect to the testnet (and add the network) by going to the Offical App Hub and clicking on the \'Add Network\' button. \\n https://testnet.somnia.network","what is the latest news about somnia?":"","what are some good defi projects on somnia?":"There are many deFi projects on Somnia. Here are some of them: \\n 1. Somnex: Native one stop deFi on Somnia \\n https://testnet.somnex.xyz/ \\n 2. Somnia Exchange: Native dex on Somnia \\n https://somnia.exchange/ \\n 3. Standard: On-chain order book and \'super\' deFi app \\n https://standardweb3.com/ \\n 4. Euclid Protocol: Decentralized, unified cross-chain liquidity infrastructure \\n https://www.euclidprotocol.io/ \\n The other deFi projects can be viewed on https://testnet.somnia.network in the App Hub section.","what are some good nft marketplaces on somnia?":"","what are some good infrastructure projects on somnia?":"There are many infrastructure projects on Somnia. Here are some of them: \\n 1. Blocksense: Programmable oracle network supporting over 700 crypto \\n https://blocksense.network/ \\n 2. Glacis Labs: A platform that monitors, abstracts and secures all cross chain interactions \\n https://glacislabs.com/ \\n 3. RubyScore: Decentralized reputation score system helping projects identify and reward legitimate community members based on credibility/reputation scores \\n https://rubyscore.io/ \\n 4. Gamers L.A.B.: Coming Soon  \\n https://uprising-labs.gitbook.io/gamers-lab \\n The other infrastructure projects can be viewed on https://testnet.somnia.network in the App Hub section.","what are some good nft projects on somnia?":"Being a relatively new ecosystem, Somnia NFTs are starting to pick up steam just now. Currently, there is \\n 1. Quills: The first PFP NFT collection on Somnia \\n https://quills.fun/ \\n Stay tuned for more project launches.","what are some good wallets for somnia?":"All wallets that support EVM chains can be used for Somnia. MetaMask, Coinbase, and Binance wallets are some of the popular choices. To add the Somnia Testnet to these wallets, please go to their respective docs and add the Somnia Testnet to them. \\n You can download MetaMask here: \\n https://metamask.io","what are some good social projects on somnia?":"","what are some good game projects on somnia?":"There are many gaming projects on Somnia. Here are some of them: \\n 1. Lucky Adventure Gambit: Turn based RPG, dice-based game mechanics \\n https://playlag.com/ \\n 2. Chunked: Fully on-chain sandbox MMO \\n https://chunked.xyz/ \\n 3. Galeon: No-code game builder \\n https://gameland.network/ \\n 4. Dark Table CCG: 4-player collectible card game \\n https://darktableccg.com/ \\n The other gaming projects can be viewed on https://testnet.somnia.network in the App Hub section.","what is the tokenomics of somnia?":"Since the Somnia token $SOMI hasn\'t yet had a mainnet launch, there are no concrete details on the tokenomics. Please follow the official Somnia blog to keep track of the latest developments on the same.","what is the total supply of somnia tokens?":"The Somnia token ($SOMI) is the Native token of the Somnia blockchain, with a fixed supply of 1,000,000,000 tokens. \\n https://docs.somnia.network/concepts/tokenomics/overview","how can i buy somnia tokens?":"Currently, Somnia is in its testnet stage so you can only get the $STT tesnet tokens. You can get the test $STT tokens using the faucets. \\n https://docs.somnia.network/developer/resources-and-important-links#faucet","where can i trade somnia tokens?":"Currently, you can use the official Somnia Swap to trade tokens. Please note that the swap is currently in the testnet phase and these tokens don\'t have any financial value. This is only for previewing the Somnia Mainnet experience, once it launches. \\n https://testnet.somnia.network/swap","what is the use case for somnia token?":"Being a lightning fast blockchain with the potential for over 1,000,000 transactions every second, the Somnia chain has a use case in building deFi, gaming, metaverse, social, and Real World Asset (RWA) decentralized applications. The somnia token, $SOMI will act as the standard currency to leverage the somnia chain for these applications. Other than these, the $SOMI token also would be usable for the other operations that fungible tokens support, like staking, transfer, swaps, and so on. Additionally, $SOMI is a delegated proof of stake token (dPoS) it is intended for: \\n 1. Staking functions \\n Validator staking - To provide validator nodes for the Somnia blockchain, Tokens must be staked. \\n Delegated staking - Tokens can be delegated to Node Providers to cover their staking costs. \\n 2. Payment methods \\n Gas Fees - To use the blockchain, gas fees will be paid in the SOMI token. \\n 3. Governance: The Token will eventually be used to inform how decisions regarding the Network and its components are made. The details of this are to be determined.","what is the somnia token distribution?":"Since the Somnia token $SOMI hasn\'t yet had a mainnet launch, there are no concrete details on the token distribution. However, the announcement about the launch has been made on the official Somnia outlets. Only 20% of the allocated community airdrop tokens are released at TGE, with the remaining 80% released over 60 days after the mainnet launch, contingent on users completing specific tasks. Any unclaimed tokens from the airdrop after the 90-day window will be returned to an ecological fund for future ecosystem growth and incentives. The detailed token distribution can be found here: \\n https://docs.somnia.network/concepts/tokenomics/allocation-and-unlocks","where can i stake on somnia?":"Currently, Somnia is in the testnet phase so you cannot meaningfully stake the tokens. Please stay tuned for the mainnet launch, and the announcement of the mainnet Somnia $SOMI token.","how do i develop on the somnia blockchain?":"Being an EVM chain, development on Somnia is similar to that on any other EVM chain like Arbitrum or Sei, or even Ethereum. You will need a wallet that supports EVM chains, for example MetaMask, and have the required test tokens to be able to deploy on the Somnia Testnet. You can use the Remix IDE to write the smart contracts online, in the browser itself. \\n https://docs.somnia.network/developer/resources-and-important-links#ide \\n You can check out the tutorials here: \\n https://docs.somnia.network/developer/tutorials \\n https://testnet.somnia.network","what are the developer tools for somnia?":"All the developer tools for Somnia are mentioned in the official docs. You can check them out here: \\n https://docs.somnia.network/developer/resources-and-important-links","how can i deploy a smart contract on somnia?":"Being an EVM chain, development on Somnia is similar to that on any other EVM chain like Arbitrum or Sei, or even Ethereum. The contracts are in Solidity, similar to the chains mentioned. You will need a wallet that supports EVM chains, for example MetaMask, and have the required test tokens to be able to deploy on the Somnia Testnet. You can use the Remix IDE to write the smart contracts online, in the browser itself. Once the code is written, use the compile option followed by the deploy option. Make sure you are connected to your wallet on the right network (Somnia Testnet) while invoking the deploy function. \\n https://docs.somnia.network/developer/resources-and-important-links#ide \\n You can check out the tutorials here: \\n https://docs.somnia.network/developer/tutorials \\n https://testnet.somnia.network","what programming languages does somnia support?":"Being an EVM based Layer 1, Somnia supports Solidity. Any smart contract written for Ethereum, Polygon, Arbitrum, etc in Solidity can be deployed to Somnia as well.","how do i access the somnia network\'s api":"","how is gas fee on somnia":"Somnia’s model follows Ethereum’s structure: Total Fee = Gas Usage x Gas Unit Price \\n Gas Usage \\n Total gas units consumed by a transaction, determined by the following formula: \\nGas Usage = Base Gas + Transaction Data + Opcodes. \\n https://docs.somnia.network/concepts/tokenomics/gas-fees","how do i setup a node on somnia?":"","how secure is somnia":"Somnia is an EVM-compatible Layer 1 blockchain designed for high-performance applications, and its security model is built around a Proof-of-Stake (PoS) consensus mechanism with a MultiStream protocol. Here are key aspects of its security: \\n 1. Proof-of-Stake with Slashing: Somnia uses a PoS system where validators stake tokens to participate in network consensus. Malicious behavior, such as double-signing or downtime, results in slashing penalties, aligning validator incentives with network security. \\n 2. MultiStream Consensus: This protocol, inspired by Autobahn BFT, separates data production from consensus. Validators operate independent data chains, while a separate consensus chain ensures global transaction ordering using a modified Practical Byzantine Fault Tolerance (PBFT) algorithm. This reduces vulnerabilities by isolating consensus processes. \\n 3. Sufficient Decentralization: Somnia prioritizes \'sufficient\' rather than maximal decentralization to balance security and performance. It initially operates with 100 globally distributed validator nodes, with plans to expand as the network matures. Hardware requirements are set between Solana and Aptos node specs to ensure robust participation without compromising performance. \\n 4. Advanced Cryptographic Techniques: Posts on X suggest Somnia employs advanced cryptographic protocols like homomorphic encryption and multi-party computation (MPC) for secure data handling, though these claims require further verification. \\n 5. CertiK Monitoring: Somnia is tracked by CertiK’s Skynet for security audits, on-chain monitoring, and bug bounties, indicating proactive security measures. \\n 6. Immutable Transactions: The network ensures tamper-proof transactions, enhancing security through immutability and transparency. \\n While Somnia’s architecture emphasizes security, its long-term track record is still developing, as it remains in the testnet phase. Investors and developers should monitor validator decentralization and real-world stress tests for a complete assessment.","how can i join the somnia community?":"You can start by joining the official Somnia Discord: \\n https://discord.com/invite/somnia \\n You can also join the official Somnia Telegram: \\n https://t.me/somnianetwork","how does somnia prevent hacks and exploits?":"","how fast are transactions on somnia?":"As per the pre-mainnet runs, Somnia has sub second finality for its transactions, meaning they can be completed in under a second.","what is somnia\'s roadmap?":"Somnia’s roadmap is not fully detailed in public sources, but available information outlines key milestones and ongoing efforts: \\n Testnet Phase (Ongoing): Somnia launched its Shannon Testnet on February 20, 2025, following DevNet benchmarks that achieved over 1 million transactions per second (TPS). The testnet focuses on scalability, third-party validator integration, and staking protocols to enhance decentralization. It has processed over 3.6 million transactions across 300,000+ unique addresses. \\n Mainnet Launch (2025): Somnia is gearing up for its mainnet launch later in 2025, though no specific date is confirmed. The mainnet will support fully on-chain applications, including gaming, DeFi, and metaverse platforms. \\n    Ecosystem Expansion: Somnia has introduced 14 decentralized applications (dApps) on its testnet, covering DeFi, gaming, AI, and metaverse use cases. Projects like Chunked (a sandbox MMO) and Sparkball (a multiplayer sports game) are driving transaction volume. A $10 million ecosystem grant program supports developer engagement. \\n    Developer Tools and Interoperability: Somnia is focusing on low-code tools like Somnia Builder and omnichain protocols to enable seamless asset transfers across blockchains. It aims to unify gaming, metaverse, and NFT ecosystems into a \'Virtual Society\'. \\n    Community Engagement: Initiatives like Galxe campaigns, daily check-ins, and a potential airdrop for testnet participants are part of Somnia’s strategy to attract 1 million users to stress-test the network. \\n    Future Goals: Somnia aims to support real-time, data-intensive applications at scale, with a focus on gaming and social platforms. Long-term, it seeks to establish a decentralized creator economy with interoperable digital assets. \\n    The roadmap emphasizes scalability, developer adoption, and ecosystem growth, but specific timelines beyond the mainnet launch are unclear. Please follow the official channels like Somnia’s Discord or X account for more updates on this.","tell me about the somnia team.":"Key members of the Somnia Network team include: Paul Thomas (Founder)\\n Michelle Kang (CMO)\\n Sal Liberto Jr (Head of Business Development)\\n You can find their details here: \\n https://cryptorank.io/price/somnia/team","how can i earn rewards on somnia?":"Currently, there is no such campaign. Users are encouraged to do the testnet tasks like swaps and NFT purchase, but there is no guarantee that these will be used as a criterion while distributing airdrop rewards to the community.","what is awesom ai?":"Awesom AI is a Somnia-centric AI Agent. Known for its vast collection of cached and free queries, it aims to be the one stop solution for all Somnia-related queries. It is maintained by the Resurgence Labs team.","how does awesom ai work?":"Awesom AI enables the user to submit info, transactional, and custom queries. The info queries are cached and maintained by continuous scraping of the Somnia ecosystem, while the custom queries make an additional call to an AI backend.","what can i do with awesom ai?":"You can have your queries about the Somnia Network answered with Awesom AI. You can receive a basic tutotial for development on Somnia. You can also complete transactions like sending testnet $STT tokens and swaps using it. You can also complete custom queries using an integrated AI backend.","can awesom ai be used for defi actions?":"Yes. Awesom AI can be used to complete de-fi actions like swapping and transfer of funds. However, this ultimately makes a wallet call on your behalf and the transaction can be completed only after you have signed it. Therefore, please evaluate the transaction details before signing. For more details, please read the Awesom AI docs.","how many transactions happen daily on somnia?":"Somnia’s transaction volume is primarily reported from its testnet phase, as the mainnet is not yet live. Available data highlights: \\n    Peak Performance: Somnia’s testnet achieved a record of 80 million transactions in a single day, driven largely by the sandbox MMO game Chunked, which alone generated 250 million transactions over a week with over 70,000 concurrent users. \\n    Testnet Activity: The Shannon Testnet has processed over 3.6 million transactions across 300,000+ unique addresses, but daily averages are not consistently reported. The 80 million transaction peak is an outlier tied to specific testnet activities. \\n    Network Capacity: Somnia claims a capacity of over 1 million TPS, with sub-second finality and sub-cent fees, demonstrated in DevNet benchmarks. However, real-world daily transaction volumes depend on user activity and dApp adoption, which are still scaling.\\n    Comparison: The 80 million daily transactions surpass Ethereum’s peak of 1.9 million and Solana’s peak of 66.9 million, though these figures reflect testnet conditions, not sustained mainnet performance.\\n    Since Somnia is in testnet, daily transaction volumes fluctuate based on testing activities and are not representative of mainnet performance. Once the mainnet launches, consistent daily metrics will depend on adoption and use cases like gaming and DeFi. For the latest data, users should check Somnia’s official analytics or testnet dashboards.","how many transactions happen monthly on somnia?":"","what is the average gas fee on somnia?":"","where can i track my somnia transactions?":"You can use the shannon explorer to track your transactions. \\n https://shannon-explorer.somnia.network","what are the best tutorials for somnia beginners?":"Somnia has some good tutorials for getting started with smart contract and dapp development on its official site. You can check it out here: \\n https://docs.somnia.network/developer/tutorials","what are the first steps to explore somnia?":"","how do i connect my wallet to somnia dapps?":"By clicking the \'connect\' button, usually on the top right of any Somnia dapp, you will be prompted to login with your EVM wallet. You just need to connect and give permission to the wallet extension to work with the dapp. If you need detailed instructions on how to setup your wallet, you can check out the guide for MetaMask here: \\n https://support.metamask.io/start/getting-started-with-metamask \\n Similarly, you can check out the guide for Coinbase wallet here: \\n https://www.coinbase.com/en-in/wallet/articles/getting-started-extension","how can i integrate somnia into my application?":"To integrate Somnia into your application, you will need to add a functionality to connect to different wallets that support Somnia. Each wallet has its own integration documentation. For MetaMask, the docs can be found here: \\n https://docs.metamask.io \\n For the coinbase wallet, the docs can be found here: \\n https://docs.cdp.coinbase.com/coinbase-wallet/introduction/welcome \\n Once the connection is done, if you\'re using a particular smart contract on Somnia and calling it from your application, follow any ethereum or any other EVM chain tutorial to call a smart contract from the javascript or typescript code.","what analytics tools work with somnia?":"","what are the best sdks for building on somnia?":"","what are the best decentralised exchanges on somnia?":"","what are the best decentralized swaps on somnia?":"Currently you can use the official swap to swap tokens on the Somnia Testnet. Others will be added to the list as they become available. \\n https://testnet.somnia.network/swap","how do i test my dapp on somnia’s testnet?":"Remix IDE is an online editor that can be used for testing the smart contracts on the Somnia Testnet. Make sure you have connected to the Somnia Testnet network using your wallet, such as Metamask. Make sure the Somnia Testnet is the network active. Paste your smart contract and run compile. If it goes correctly, go to the deploy option and choose Injected Provider for the account. Then click deploy. You will be prompted to sign the transaction with your wallet.","what are somnia’s smart contract standards?":"Somnia uses the ERC20 standard for Fungible Token Smart Contracts, and the ERC721 standard for Non Fungible Tokens, even though other ERC standards are also used.","how can i get developer support for somnia?":"Please join the Somnia discord for developer support. You can also raise an issue on their offical GitHub if you need support with regards to a bug on their end.","what events are happening on somnia?":"","what events happened recently on somnia?":"","how can i join somnia’s discord?":"Please click on the given link to accept the invite: \\n https://discord.com/invite/somnia","what are somnia\'s official links?":"Website: https://somnia.network \\n Docs: https://docs.somnia.network \\n Blog: https://blog.somnia.network \\n Twitter/X: https://x.com/Somnia_Network \\n Telegram: https://t.me/somnianetwork \\n Discord: https://discord.com/invite/somnia","what are somnia’s community rewards programs?":"Somnia has a community rewards program called Somnia Quests. You can try it out here: \\n https://quest.somnia.network","what is somnia’s grants programs?":"Somnia has an extensive Developer Grants Program. \\n https://blog.somnia.network/somnia-announces-10-million-grant-program-in-anticipation-of-devnet-launch \\n The program aims to help connect promising developers with leading Web3 investors including Mirana Ventures, Spartan Capital, and CMT Digital, and to support builders creating large-scale, real-time applications across gaming, social platforms, metaverses, and more. \\n If you wish to apply for grants, you can use the following link: \\n https://app.deform.cc/form/523ee5e8-1280-4add-b496-1d220fd3675c","how do i participate in somnia hackathons?":"The hackathons on Somnia happen from time to time. The official announcements are always on the Somnia Blog, as well as on the Official Discord. Please follow the announcements there and follow the instructions posted there in order to participate in the hackathons.","what are the costs of deploying on somnia?":"Since Somnia is currently in the testnet phase, we can only provide an estimate based on the transactions per second, expected number of nodes, and so on. The cost of deploying on Somnia is expected to be a few cents, similar to other fast EVM chains like Sei.","what is the latest on somnia airdrops?":"As of now, there is no official announcement on the Somnia Token airdrop. Please only refer to the official Somnia website and X/Twitter accounts for information on the same. Please be aware that scammers might post links claiming to be the airdrop while pretending to be the official handle. Access any such link only after due dilligence.","how can i collaborate with other somnia developers?":"The best way of collaborating with other Somnia developers would be to join the offical Somnia Discord, and accessing the dev-chat channel (after getting the dev role). There, there is an opportunity to talk to other developers in a condusive and productive environment. You can also use the official Telegram Group for this. \\n Discord: https://discord.com/invite/somnia \\n Telegram: https://t.me/somnianetwork","what should i do if my somnia transaction fails?":"Please use your wallet to get the transaction ID, then go to the explorer to check if there is any information about the cause of failure. It might be because the testnet is down, which can be checked at the top right corner of: \\n https://testnet.somnia.network \\n or because you don\'t have enough testnet $STT tokens to complete the transaction. \\n If nothing helps, please create a support ticket on the official Somnia Discord: \\n https://discord.com/invite/somnia","how do i recover my somnia wallet?":"Just like any other cryptocurrency wallet, recovering your Somnia wallet is possible only if you have its private key or the 12 (or 24) word phrase. This is why please write down these details, preferably on hard copy and keep it somewhere safe. Don\'t share your keys with anyone. If you have these details, use the Import Account option on your wallet and input the private key or phrase.","how do i report a bug on somnia?":"The simplest way to report a code bug would be to create an issue in the related repository on the Offical Somnia GitHub handle: \\n  \\n You can also create a support ticket on their Official Discord: \\n https://discord.com/invite/somnia","what new features are coming to somnia?":"","when will somnia’s mainnet launch?":"There has been no official announcement as of now. Please use only the official Somnia handles to track any announcements regarding the same, and be cautious of unauthorized handles claiming to be insiders, and offering often incorrect alpha on the same.","when will the somnia token launch?":"There is now an official announcement about the Somnia token launch. The token is called $SOMI. The $SOMI token launch is tied to the upcoming Somnia mainnet launch, which is the next stage after the successful Devnet and Shannon Testnet phases that processed billions of transactions and reached over 1 million transactions per second. A phased airdrop for early testnet users began around mid-August 2025, with 20% of the community share released at token generation event (TGE) and the remaining 80% released over the following 60 days after mainnet launch. \\n https://gam3s.gg/news/somnia-announces-somi-token/","how can i join the somnia team?":"","what are the best explorers on somnia?":"You can use the shannon explorer to track your transactions, smart contracts, accounts, etc on Somnia. \\n https://shannon-explorer.somnia.network \\n More explorers will be added to the list as they become available for public use.","where can i read the somnia whitepaper?":"https://docs.somnia.network//litepaper","how do i apply for developer access on somnia?":"You can apply for developer access by filling out this form: \\n https://somnia.fillout.com/t/4ngZsB8is9us \\n Please note that your odds of successfully getting access can be improved by: \\n 1. Having a smart contract deployed on the Somnia Devnet \\n 2. Having a working demo Somnia dapp with a public link","how does somnia\'s omnichain interoperability work?":"Somnia’s omnichain interoperability enables seamless asset and data transfers across EVM and non-EVM blockchains using a decentralized bridge protocol. Built on its MultiStream architecture, it leverages cross-chain messaging and standardized token wrappers to facilitate transfers. Validators secure the bridge by attesting to state changes, ensuring trustless communication. The Somnia Builder tool simplifies integration for developers, supporting interoperable dApps in gaming and DeFi. Testnet demos show NFT and token bridging, but mainnet scalability and bridge security (e.g., against double-spend attacks) await real-world validation. Limitations include potential latency and reliance on validator consensus.","how does somnia\'s multistream consensus work?":"Somnia’s MultiStream protocol uses a modified PBFT algorithm, ensuring consensus even if up to one-third of validators are offline or partitioned. Data chains operate independently, and the consensus chain maintains global ordering, minimizing disruption. Recovery mechanisms prioritize validator resync with minimal latency.","what are the specific hardware specs for somnia validator nodes?":"Somnia validator nodes require hardware between Solana and Aptos specs: approximately 16-core CPU, 64GB RAM, 1TB NVMe SSD, and 1Gbps network bandwidth. Exact requirements may adjust post-mainnet, balancing accessibility and performance for 100+ global nodes.","how does somnia\'s testnet handle spam transactions?":"Somnia’s testnet mitigates spam through rate-limiting and gas fees, even in testing. The MultiStream protocol’s high throughput (1M+ TPS) absorbs spam attempts, while validator slashing deters malicious flooding. Testnet data shows resilience during 80M transaction spikes.","what type of encryption does somnia use?":"Somnia reportedly uses homomorphic encryption for secure data processing in privacy-sensitive dApps (e.g., DeFi or metaverse). This allows computations on encrypted data without decryption, though implementation details are sparse and await mainnet confirmation.","what is somnia builder?":"Somnia Builder is a low-code platform with drag-and-drop interfaces and pre-built templates for dApps in gaming, NFTs, and DeFi. It abstracts EVM complexity, enabling non-coders to deploy smart contracts via visual workflows, with SDKs for advanced customization.","how to use somnia builder?":"","what are the limitations of somnia\'s omnichain interoperability?":"Somnia’s omnichain protocol enables asset transfers across EVM and non-EVM chains, but it’s limited by bridge security risks and latency in cross-chain finality. Testnet supports basic asset bridging; mainnet will expand compatibility but may face scaling challenges.","how does somnia\'s slashing mechanism work?":"Validators stake SOM tokens and face slashing for downtime, double-signing, or malicious behavior. Penalties deduct a percentage of staked tokens (exact rates undisclosed), enforced by the MultiStream consensus to ensure validator accountability and network stability.","what metrics does somnia\'s testnet dashboard provide?":" Somnia’s testnet dashboard tracks TPS, transaction volume (e.g., 3.6M total), unique addresses (300K+), validator uptime, and dApp activity (e.g., Chunked’s 80M daily txns). Real-time analytics help developers monitor performance and stress-test results.","how does somnia support real-time gaming applications?":"Somnia’s sub-second finality and 1M+ TPS enable real-time gaming via MultiStream’s parallel data processing. Games like Chunked leverage this for seamless multiplayer interactions, with low gas fees (<$0.01) ensuring cost-effective microtransactions.","what is the process for third party validators to join somnia?":"Third-party validators apply via Somnia’s governance portal (post-mainnet), staking SOM tokens and meeting hardware specs. Testnet includes external validators for testing, with a vetting process to ensure geographic diversity and reliability.","where can i check my eligibility for the somnia airdrop?":"register.somnia.network","what is the token supply of $somi?":"The Somnia token ($SOMI) is the Native token of the Somnia blockchain, with a fixed supply of 1,000,000,000 tokens. \\n https://docs.somnia.network/concepts/tokenomics/overview","what is cuthbert?":"Cuthbert is a separate implementation of Somnia\'s execution and database, using third party libraries, and without optimisations. Each transaction is run through both Somnia and Cuthbert by the validators, and voting or executiopn is stopped if they ever detect a divergence between the two. This means that if the Somnia client has a bug or an issue in its execution or database, that bug would also have to be present in the separate Cuthbert implementation if this bug were to go undetected. \\n Note: Cuthbert will eventually be phased out of Somnia as the system becomes more mature.","what is the unlock schedule of the $somi token?":"The $SOMI token has a multi-year vesting schedule for all initial holders including the community. The team, investors, advisors, and launch partners also have a cliff of 12 months during which they cannot transfer their tokens. The detailed schedule can be viewed here: \\n https://docs.somnia.network/concepts/tokenomics/allocation-and-unlocks","how is the somnia token governance?":"The Somnia governance system has 5 different groups: \\nToken house - Token owners that primarily govern allocation of foundation and community tokens \\nValidator council - Validators in control of hard forks, gas economics and network upgrades. \\n Developer council - Key developers that oversee the technology roadmap \\n User assembly - Key users who are used as a check and balance to other groups \\n Foundation board - Initially in control of the treasury and deployment of new code to the network. Eventually used as a conduit for the other participants and emergency overrides. \\n https://docs.somnia.network/concepts/tokenomics/tokens-governance","where can i report suspicious or unlawful use of somnia?":"For compliance-related inquiries or to report suspicious activities: \\n Money Laundering Reporting Officer (MLRO): \\n Campbells Regulatory Services Limited \\n Email: Compliance_Services@campbellslegal.com"}');
