async function transferTokens(target, amount) {
  const rpcUrl = 'https://rpc.testnet.somnia.network';
  const chainId = '0xc488';

  try {
    // Check MetaMask availability
    if (typeof window.ethereum === 'undefined') {
      throw new Error('MetaMask is not installed');
    }

    // Request account access
    await window.ethereum.request({ method: 'eth_requestAccounts' });

    // Switch to Somnia Shannon Testnet
    try {
      await window.ethereum.request({
        method: 'wallet_switchEthereumChain',
        params: [{ chainId }],
      });
    } catch (switchError) {
      if (switchError.code === 4902) {
        await window.ethereum.request({
          method: 'wallet_addEthereumChain',
          params: [{
            chainId,
            chainName: 'Somnia Testnet',
            rpcUrls: [rpcUrl],
            nativeCurrency: { name: 'SOMNIA', symbol: 'STT', decimals: 18 },
            blockExplorerUrls: ['https://shannon-explorer.somnia.network'],
          }],
        });
      } else {
        throw switchError;
      }
    }

    // Initialize provider and signer
    const provider = new BrowserProvider(window.ethereum);
    const signer = await provider.getSigner();
    const signerAddress = await signer.getAddress();
    if (!signerAddress) {
      throw new Error('No signer available. Please connect MetaMask.');
    }

    // Verify network
    const network = await provider.getNetwork();
    if (network.chainId !== 50312n) {
      throw new Error('Wrong network. Please connect to Somnia Shannon Testnet.');
    }

    // Validate recipient address
    if (!checks_isAddress(target)) {
      throw new Error('Invalid recipient address');
    }

    // Check native STT balance
    const decimals = 18;
    const amt = units_parseUnits(amount.toString(), decimals);
    const balance = await provider.getBalance(signerAddress);
    console.log('Balance:', formatUnits(balance, decimals), 'STT');
    if (balance < amt) {
      throw new Error(`Insufficient STT balance: ${formatUnits(balance, decimals)} available`);
    }

    // Check SOM balance for gas
    const feeData = await provider.getFeeData();
    const gasLimit = 21000n; // Standard for native transfers
    const gasCost = feeData.maxFeePerGas * gasLimit;
    if (balance < gasCost) {
      throw new Error(`Insufficient STT for gas: ${formatUnits(gasCost, decimals)} needed`);
    }

    // Send native STT transaction
    const tx = await signer.sendTransaction({
      to: target,
      value: amt,
      gasLimit,
      maxFeePerGas: feeData.maxFeePerGas,
      maxPriorityFeePerGas: feeData.maxPriorityFeePerGas
    });
    console.log('Transaction sent! Hash:', tx.hash);

    // Wait for confirmation
    const receipt = await tx.wait();
    console.log('Transaction confirmed in block:', receipt.blockNumber);

    return { txHash: tx.hash, blockNumber: receipt.blockNumber };
  } catch (error) {
    console.error('Error during transfer:', error);
    throw error;
  }
}
